import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home">
      <h1 className="home-title">Welcome to Food Hall Cafe</h1>
      <p className="home-subtitle">
        Experience the perfect blend of comfort, taste, and ambiance. Join us for an unforgettable coffee experience.
      </p>
      <div className="image-gallery">
        <img src="path/to/image1.jpg" alt="Delicious Coffee" />
        <img src="path/to/image2.jpg" alt="Pastry Display" />
        <img src="path/to/image3.jpg" alt="Cozy Seating Area" />
        <img src="path/to/image4.jpg" alt="Outdoor View" />
      </div>
    </div>
  );
};

export default Home;
